description:
The Football League Show 18.10.2014 

Duration: 1 hour 20 min

As the Football League Show returns after the international break, our featured match comes from the Madejski as Reading meet Derby. Russell Slade's Cardiff entertain Nottingham Forest and there's the best of the action from a Yorkshire derby as Rotherham go head-to-head with Leeds.
Drama from all three divisions of the Football League brought to you by Manish Bhasin.

